#include "../uncertaintyTE/uncertainty.h"

#define BOOST_TEST_MODULE eigenValuesOutput
#include <boost/test/included/unit_test.hpp>
#include <boost/test/floating_point_comparison.hpp>

#include <string>
#include <iostream>
#include <fstream>
#include <sstream>


using namespace cov;


void loadUncertainty(Uncertainty &u) {
	std::cout << std::string(TESTS_ROOT_DIR) + std::string("/EigValues/output.cov") << "\n";
	std::ifstream file(std::string(TESTS_ROOT_DIR) + std::string("/EigValues/output.cov"), std::ios_base::in);
	if (!file.good()) {
		std::cerr << "\nERROR: The example file does not exist!\n";
		exit(0);
	}

	// Camera uncertainty
	u._numCams = 64;
	u._numPoints = 200;
	u._camParams = 9;
	u._nbCovarianceValuePerCam = (0.5 * u._camParams * (u._camParams + 1));
	u._camerasUnc.reserve(u._numCams * u._nbCovarianceValuePerCam);
	u._pointsUnc.reserve(u._numPoints * 6);

	// read lines
	int k = 0;
	std::string line = std::string();
	while (!file.eof()) {
		line.clear();
		getline(file, line);
		if (line.size() > 1 && line.at(0) != '#') {
			double d = 0;
			if(k < u._numCams){
				std::istringstream line_stream(line);
				while (line_stream >> d)
					u._camerasUnc.push_back(d);
				k++;
			}
			else {
				std::istringstream line_stream(line);
				while (line_stream >> d) 
					u._pointsUnc.push_back(d);
			}
		}
	}

	file.close();
}



