BOOST_AUTO_TEST_CASE(compose_one_point_covariance_matrix) {
	Uncertainty unc;
	loadUncertainty(unc);
	std::vector<double> covPt143 = unc.getPointUncMatrix(142);  // ids are from 0
	static const double res[] = { 6.807380e-04,-3.230500e-04,-1.908180e-04,-3.230500e-04,3.164680e-03,1.503980e-03,-1.908180e-04,1.503980e-03,1.851370e-03 };
	for (int i = 0; i < 9; i++)
		BOOST_CHECK_SMALL(covPt143.at(i) - res[i], 1e-5);
}

